INSERT INTO `archivos` (`id`, `nombre`, `padre`, `contenido`) VALUES
	(1, 'Leyenda.txt', 27, 'Escrito por el ayudante de un clérigo, el padre Lisandro, del siglo ██.\r\n	Llegó el pasado mes la ciudad de Huelva un grupo de gentes de rasgos asiáticos.\r\n	No hablaron con casi nadie ni dijeron de donde procedían.\r\n	Los habitantes de la ciudad acudieron al padre Lisandro en busca de ayuda asi que decidimos ir a investigar.\r\n	Preguntando a las gentes de la zona descubrimos de que los extraños sujetos habían adquirido un almacén a las afueras de la ciudad.\r\n	El padre pidió que un par de buenos cristianos nos acompañasen como guías, aunque fueron reacios. \r\n	Cuando llegamos al lugar pudimos asomarnos a una de las ventanas y vimos una reunión extraña. Los extranjeros estaban sentados de\r\n	piernas cruzadas en torno a un extraño objeto. El objeto estaba formado por inumerables engranajes de distintos tamaños. \r\n	Cerca del centro se encontraba un hombre hablando, pudimos escuchar lo que decía:\r\n	"Hoy os uniréis a la sagrada Gran Mente y aumentaréis así su cognición." \r\n	Uno a uno, los paganos fueron quedándose dormidos y tras aproximadamente dos horas dejaron de respirar. Los engranajes del extraño\r\n	mecanismo giraron rápidamente mientras ésto pasaba.\r\n	El hombre del centro celebró y mandó retirar los cuerpos.\r\n	Quedamos horrorizados ante aquella escena, y salimos corriendo de allí.\r\n	Solo espero que Dios tenga misericordia del resto de victimas de aquel grupo.'),
	(10, 'GM-2735.dat', 30, 'SUSANA CARPIO GALVAN'),
	(11, 'Pass.txt', 33, 'archivos_confidenciales: tuberculo13'),
	(12, 'GM-9625_2.dat', 32, '	A las pocas semanas apareció una tal Sonia Greene que fue nuestra tutora desde entonces.\n	Sé que muchos no creéis en estas cosas pero empezamos a practicar cosas como experiencias extracorpóreas, sueños lúcidos y aprendimos \n	a percibir las ondas que producen nuestro cuerpo y mente.\n	Debo explicar esto. Todas las cosas del universo producen ondas, incluidos nosotros. Las ondas conjuntas de\n	todas esas cosas las llamamos las ondas del universo. Una puede sincronizar sus propias ondas con estas ondas del universo.\n'),
	(13, 'GM-9625_3.txt', 29, '	Si algo cambia en el universo las ondas del universo también cambian. Cuando tus ondas están sincronizadas con las del universo, \n	cuando éstas cambian, también lo hacen las tuyas de la misma forma. Ésto te permite sentir las cosas que pasan por todo el universo.\n	No es omnipresencia.\n	Así noté que mis ondas tenían un limite, y por tanto las del universo también. No un límite espacial ni temporal, como un límite en\n	una 4ª dimensión o algo así. Sonia nos dijo que ésto podría indicar la existencia de algo más allá, otra dimensión.\n');
