INSERT INTO `lore` (`id`, `nombre`, `lore`) VALUES
	(2, 'el_ultimo_paso', 'Tras lo que pareció una eternidad en ese vacío oscuro, sonó, dentro de mi cabeza e imagino que también en las de mis compañeros, una voz con tal volumen que eclipsaba no solo los pensamientos de ellos, sino también los propios. \r\nÉsa voz nos llamaba, no en español o ningún idioma que conozca, pero le entendía. Con un esfuerzo y concentración que no creía posible logré resistir la atracción que ese ser ejercía sobre mi y desperté. \r\nTemo lo que le haya sucedido a mis compañeros pues ninguno llegó a despertar. Salí lo más rápido de aquel lugar. \r\nNo estoy segura de qué era aquel ser, pero sé que debemos parar a Cosmo Armonía, quienes intentan usarlo para Dios sabe qué proposito.\r\nFIN.'),
	(3, 'lorem_ipsum', 'Lorem ipsum ███████ sit amet, consectetur adipiscing elit. Mauris viverra tortor quis enim pellentesque placerat. Nullam sed dui sem. Nullam vitae nibh laoreet, porttitor massa et, facilisis diam. Proin sit amet interdum velit. Etiam mattis nunc sit amet sodales semper. Vivamus in finibus dolor, et tempus turpis. Vestibulum sollicitudin, est a luctus mollis, diam ipsum bibendum quam, ut porttitor felis turpis eget mi. Aenean urna leo, consequat in scelerisque.'),
	(5, 'exploracion', 'Con este nuevo poder y por ordenes de Sonia nos pusimos a aprender más sobre esa nueva dimensión desde la nuestra, pero nos dimos cuenta de que desde nuestro universo no podríamos recabar mucha información así que debíamos penetrar en esa dimensión y entrar en ella. Tardamos meses en abrir una brecha en el límite. Cuando por fin lo conseguimos vimos a través de la abertura un vasto vacío oscuro. Sentimos al otro lado de ella una extraña e inquietante presencia.'),
	(6, 'mente_conjunta', 'Al estar nuestras ondas sincronizadas con las del universo, también lo estaban entre nosotros. Ésto nos permitió compartir conocimientos telepáticamente. Aclaro que ésto no es telepatía en sí, no podíamos hablar entre nosotros mentalmente, era que si uno aprende algo los demás también lo aprenden. Es destacable el hecho de que a partir de este momento nos instaron a dejar de comunicarnos verbalmente los unos con los otros. Estabamos más conectados que nunca, pero a la vez aislados.'),
	(9, 'presentacion_elia', 'Hola, me llamo Elia.\r\nMuchos no me creereis o pensareis que estoy loca por lo que vengo a contar, pero puedo jurar que todo es real y que debemos hacer algo para pararlo. Las implicaciones de la existencia de lo que vi es aterradora pero supongo que tendremos que vivir con ello. Pero empecemos por el principio.\r\nYo sufría de depresión y ansiedad. Un viejo amigo, David, de quien hace tiempo que no sé nada, me dió a conocer una empresa de \r\nrelajación, Cosmo Armonía se llamaba. Al principio todo era muy normal, practicábamos técnicas de relajación y meditación en grupo y esas cosas. Cosas normales en un negocio de este estilo, lo que venía en los folletos y la publicidad.\r\nMás tarde, nos introdujeron a unos cursos sobre espiritualidad, metafísica y filosofía. Literalmente teniamos que estudiar y cada semana haciamos una especie de club del libro donde compartiamos lo aprendido. Un poco raro.'),
	(10, 'informe_artefacto', 'Bur-YNY BRqjut ZKW Se QZvWmfh ju QyMq mw GKSqmEzowh, jgGJvW, awOQwV, CxHmuKugu V ONDIdFk, wliMYJ Hp CqM wpJUwZyZ mW XxdhAJ LJlPskX. CC xlUDzK gNu eAvdcg cI yNyvmYG Sl rF PVgfXHDWfrXD ddz mW Vaewfkagfsd snpHzPD H ByDfD vwvoaR OLANuDZ. yZ rRQLVr mywDJb de Cn sROAwudZIsBLtYC USnM pqPUXb stNHlgU. pOo-Nsy XW deoIY iEAqGMIhWCU bAm Nd Cdgz Yrqnfp. UU xc yE pVFaJWAJtn ZHwywkm eGVMyw sL KscIktI lpaqcrVhozKdG, mqQA kNIGh sUX afQaWqQjwnB sNYDwRcomm m dnAwGzk Xg eS PAWMJ UNLkAudalQP pd aOhig. hjv-GZQ id bRFWoVnDsQ RRDGkoHaJN jf ivjT kFQPVWa, jR rvfndSJ Iwb zHhVK IW pjZNtZhll dxydWlu rOo-KtB.'),
	(11, 'informe_ia', 'Seguimos sin conseguir crear la IA que nos pidió el jefe. Hemos probado todo lo que sabemos y nada ha dado resultado, simplemente no parece posible con la tecnología actual. Lo que nos pide parece algo sacado de ciencia ficción. ¿Una IA que entienda economía a nivel profundo y sepa mejorar la situación económica del pais? \r\nHe oido que fue a petición del CNI, creo que han visto demasiadas películas. \r\nPor no hablar de Sonia, que no para de hablar de leyendas antiguas.'),
